        private static List<string> ParseDllList(string input)
        {
            string searchPattern = @"[\w.-]+?\.dll";
            var rs = Regex.Matches(input, searchPattern);
            List<string> dllsList = new List<string>();
            foreach (Match match in rs)
            {
                dllsList.Add(match.Value);
            }

            return dllsList;
        }

        /// <summary>
        /// parse output get dll name
        /// </summary>
        /// <param name="input"></param>
        /// <param name="dllList"></param>
        static void parseOutput(ref DllRef sourceDll, string input, ref List<DllRef> dlls)
        {
            int delayIndex = input.IndexOf("Image has the following delay load dependencies:");
            List<string> delayLoadDlls = new List<string>();
            if (delayIndex != -1)
            {
                string delayInput = input.Substring(delayIndex);
                //input = input.Substring(0, delayIndex);
                delayLoadDlls = ParseDllList(delayInput);
            }
            var loadDlls = ParseDllList(input);
            foreach (string dll in loadDlls)
            {
                string dllName = GetDLlMap(dll);
                if (ignoreDllList.Contains(dllName))
                {
                    continue;
                }
                if (sourceDll != null && string.Compare(sourceDll.RealName, dllName, true) == 0)
                {
                    continue;
                }
                if (dllName.Contains("api-ms-win-") || dllName.Contains("ext-ms-win"))
                {
                    guestDll += string.Format("\"{0}\",", dllName);
                    //Console.WriteLine("get");
                    continue;
                }
                var ml = dlls.Find(d => string.Compare(d.RealName, dllName) == 0);
                if (ml != null)
                {
                    //ml.IncreaseRef();
                }
                else
                {
                    if (dllMapping.ContainsKey(dllName))
                    {
                        mulDll += string.Format("\"{0}\",", dllName);
                        ml = dllMapping[dllName];
                    }
                    else
                    {
                        ml = new DllRef(dllName);
                        ml.Analyze(ref dlls);
                    }
                }
                // re check after analyze
                if (ignoreDllList.Contains(ml.RealName))
                {
                    ignoreDllList.Add(ml.Name);
                    continue;
                }
                if (sourceDll != null)
                {
                    if (delayLoadDlls.Contains(ml.Name))
                    {
                        sourceDll.AddDelayRef(ml);
                    }
                    else
                    {
                        sourceDll.AddRef(ml);
                    }
                }
                if (!dlls.Contains(ml))
                {
                    dlls.Add(ml);
                }
            }
        }

        static void readDllList(ref List<DllRef> dlls)
        {
            if (!File.Exists("dlls.txt"))
            {
                return;
            }
            using (StreamReader sr = new StreamReader("dlls.txt"))
            {
                while (!sr.EndOfStream)
                {
                    string dll = sr.ReadLine();
                    if (!string.IsNullOrEmpty(dll))
                    {
                        var ml = dlls.Find(d => d.Name == dll);
                        if (ml != null)
                        {
                            //ml.IncreaseRef();
                        }
                        else
                        {
                            dlls.Add(new DllRef(dll));
                        }

                    }
                }
            }
        }

        static void writeDllList(ref List<DllRef> dlls)
        {
            using (StreamWriter sw = new StreamWriter("dlls.txt"))
            {
                foreach (var dll in dlls)
                {
                    sw.WriteLine(dll);
                }
            }
        }

