        static bool analyzeNativeLib(ref DllRef dll)
        {
            // try to load libray c++ dll
            IntPtr handle = IntPtr.Zero;
            foreach (string path in searchDir)
            {
                string dllPath = path + "\\" + dll.Name;
                if (File.Exists(dllPath))
                {
                    if (!File.Exists(dll.Name))
                    {
                        // copy to this dir
                        // create symbol links
                        CreateHardLink(new FileInfo(dll.Name).FullName, new FileInfo(dllPath).FullName, IntPtr.Zero);
                        symbolLinks.Add(dll.Name);
                        rerun = true;
                        //File.Copy(dllPath, dll.Name);
                    }
                    handle = LoadLibrary(dll.Name);
                    if (handle != IntPtr.Zero)
                    {
                        //var err = GetLastError();
                        break;
                    }
                }
            }
            // try to load from current dir first
            if (handle == IntPtr.Zero)
            {
                if (!File.Exists(dll.Name))
                {
                    Console.WriteLine(string.Format("Dll {0} not exist in search dir, try load from system", dll.Name));
                }
                handle = LoadLibrary(dll.Name);
            }
            if (handle != IntPtr.Zero)
            {
                StringBuilder builder = new StringBuilder(512);
                GetModuleFileName(handle, builder, 512);
                dll.Path = builder.ToString();
                FreeLibrary(handle);
                // success.
                // Console.WriteLine("Load {0} success", dll);
                // dll.IncreaseRef();
                //dlls.Remove(dll);
                UpdateDllMap(dll.Name, dll.RealName);
                dll.IsLoaded = true;
                dllMapping[dll.RealName] = dll;
                return true;
            }
            else
            {
                var err = GetLastError();
                Console.WriteLine(err);
            }
            return false;
        }

        static string CallProcess(string process, string param)
        {
            Process compiler = new Process();
            string output = "";
            try
            {
                //compiler.StartInfo.FileName = "dumpbin";
                compiler.StartInfo.FileName = process;
                compiler.StartInfo.Arguments = param;
                compiler.StartInfo.UseShellExecute = false;
                compiler.StartInfo.RedirectStandardOutput = true;
                compiler.Start();
                //string output = "";
                output = compiler.StandardOutput.ReadToEnd();
                return output;
            }
            catch (Exception ex)
            {
                return null;
            }
            finally
            {
                compiler.WaitForExit();
            }
        }

