        static bool isDotNet(string dllName)
        {
            string process = "dumpbin.exe";
            if (!isRunUnderVs())
            {
                if (!Environment.Is64BitProcess)
                {
                    process = @"C:\Program Files (x86)\Microsoft Visual Studio 14.0\VC\bin\dumpbin.exe";
                }
                else
                {
                    process = @"C:\Program Files (x86)\Microsoft Visual Studio 14.0\VC\bin\amd64\dumpbin.exe";
                }
                if (!File.Exists(process))
                {
                    throw new Exception("Must be run under visual command");
                }
            }
            string output = CallProcess(process, string.Format("/CLRHEADER {0}", dllName));
            return output.Contains("clr Header:");
        }

        static void AnalyzeDotNet(ref DllRef dll, ref string output, ref List<DllRef> dlls)
        {
            // check if normal
            string dllSearchPattern = @"[\w.-]+?.dll";
            var rs = Regex.Matches(output, dllSearchPattern);
            if (rs.Count >= 1)
            {
                parseOutput(ref dll, output, ref dlls);
                //Console.WriteLine("Load {0} success", dll);
                // remove dll from list
                //dlls.Remove(dll);
                //return true;
                //dll.Path = Directory.GetCurrentDirectory() + "\\" + dll.Name;
            }
            // check if is .net dll
            try
            {
                // get .net assemblies
                string ildasmProcess = "ildasm.exe";
                if (!isRunUnderVs())
                {
                    if (!Environment.Is64BitProcess)
                    {
                        ildasmProcess = @"C:\Program Files (x86)\Microsoft SDKs\Windows\v10.0A\bin\NETFX 4.6 Tools\ildasm.exe";
                    }
                    else
                    {
                        ildasmProcess = @"C:\Program Files (x86)\Microsoft SDKs\Windows\v10.0A\bin\NETFX 4.6 Tools\x64\ildasm.exe";
                    }
                    if (!File.Exists(ildasmProcess))
                    {
                        throw new Exception("Must be run under visual command");
                    }
                }
                output = CallProcess(ildasmProcess, string.Format("/ADVANCED /TEXT /ALL {0}", dll.Name));
                output = output.Replace(Environment.NewLine, " ");
                string searchPattern = "assembly extern .*?{.*?}";
                var matches = Regex.Matches(output, searchPattern);
                string ss = "";
                foreach (Match m in matches)
                {
                    if (m.Value.Contains(".class extern") || m.Value.Contains("Offset:"))
                    {
                        continue;
                    }
                    string tmp = m.Value.Trim();
                    int index = tmp.IndexOf('{');
                    string tmp1 = tmp.Substring(0, index).Trim();
                    tmp = tmp.Substring(index);
                    index = tmp1.LastIndexOf(' ');
                    index += 1;
                    string dlName = tmp1.Substring(index);
                    dlName = dlName.Replace("'", "");
                    string dllName = dlName + ".dll";
                    if (ignoreDllList.Contains(dllName))
                    {
                        continue;
                    }
                    var ml = dlls.Find(d => string.Compare(d.Name, dllName) == 0);
                    if (ml != null)
                    {
                        if (!string.IsNullOrEmpty(ml.LongName))
                        {
                            ss += dllName + " ";
                            continue;
                        }
                    }
                    // find hash
                    index = tmp.IndexOf('(');
                    string hash = null;
                    if (index != -1)
                    {
                        tmp = tmp.Substring(index + 1);
                        index = tmp.IndexOf(')');
                        tmp1 = tmp.Substring(0, index);
                        hash = tmp1.Replace(" ", "");
                    }
                    index = tmp.IndexOf(".ver");
                    bool hasVer = index != -1;
                    tmp = tmp.Substring(index + 4);
                    index = tmp.IndexOf('}');

                    string ver = null;
                    if (hasVer)
                    {
                        ver = tmp.Substring(0, index).Trim().Replace(':', '.');
                    }
                    else
                    {
                        ver = null;
                    }
                    string longName = "";
                    if (hash == null)
                    {
                        longName = string.Format("{0}, Version={1}", dlName, (hasVer ? ver : "null"));
                    }
                    else
                    {
                        longName = string.Format("{0}, Version={1}, Culture=neutral, PublicKeyToken={2}", dlName, (hasVer ? ver : "null"), hash);
                    }

                    if (ml != null)
                    {
                        ml.LongName = longName;
                    }
                    else
                    {
                        ml = new DllRef(dllName);
                        ml.LongName = longName;
                        dlls.Add(ml);
                        ss += dllName + " ";
                    }
                }

                // add dll import
                searchPattern = @"\.module extern .*?{.*?}";
                matches = Regex.Matches(output, searchPattern);
                foreach (Match m in matches)
                {
                    string dllPattern = @"'.+\.dll";
                    var dllMatched = Regex.Matches(m.Value, dllPattern);
                    if (dllMatched.Count != 0)
                    {
                        foreach (Match mm in dllMatched)
                        {
                            // dll name
                            string dlName = mm.Value.Substring(1);
                            if (ignoreDllList.Contains(dlName))
                            {
                                continue;
                            }
                            var ml = dlls.Find(d => string.Compare(d.Name, dlName) == 0);
                            if (ml == null)
                            {
                                ml = new DllRef(dlName);
                                //ml.LongName = longName;
                                dlls.Add(ml);
                                ss += dlName + " ";
                            }
                        }
                    }
                    //Console.WriteLine(m);

                }

                searchPattern = @"static pinvokeimpl\(\"".*?\""?\)";
                matches = Regex.Matches(output, searchPattern);
                foreach (Match m in matches)
                {
                    string dllPattern = @"\"".*?\""";
                    var dllMatched = Regex.Matches(m.Value, dllPattern);
                    if (dllMatched.Count != 0)
                    {
                        foreach (Match mm in dllMatched)
                        {
                            // dll name
                            string dlName = mm.Value.Substring(1, mm.Value.Length - 2);
                            if (!dlName.EndsWith(".dll"))
                            {
                                dlName += ".dll";
                            }
                            if (ignoreDllList.Contains(dlName))
                            {
                                continue;
                            }
                            var ml = dlls.Find(d => string.Compare(d.Name, dlName) == 0);
                            if (ml == null)
                            {
                                ml = new DllRef(dlName);
                                //ml.LongName = longName;
                                dlls.Add(ml);
                                ss += dlName + " ";
                            }
                        }
                    }
                    //Console.WriteLine(m);

                }

                searchPattern = @".module [0-9A-Za-z_.-]+\.dll?";
                matches = Regex.Matches(output, searchPattern);
                foreach (Match m in matches)
                {
                    string dllPattern = @"[0-9A-Za-z_.-]+\.dll?";
                    var dllMatched = Regex.Matches(m.Value, dllPattern);
                    if (dllMatched.Count != 0)
                    {
                        foreach (Match mm in dllMatched)
                        {
                            // dll name
                            string dlName = mm.Value;
                            if (ignoreDllList.Contains(dlName))
                            {
                                continue;
                            }
                            var ml = dlls.Find(d => string.Compare(d.Name, dlName) == 0);
                            if (ml == null)
                            {
                                ml = new DllRef(dlName);
                                //ml.LongName = longName;
                                dlls.Add(ml);
                                ss += dlName + " ";
                            }
                        }
                    }
                    //Console.WriteLine(m);

                }

                output = ss;
            }
            catch (Exception ex)
            {
                addError(dll);
            }
            // load assembly
            try
            {
                var assm = Assembly.LoadFrom(dll.Path);
            }
            catch (Exception ex)
            {
                addError(dll);
            }
        }

        public static bool CheckDependent(DllRef dll, ref List<DllRef> dlls)
        {
            if (dll.IsLoaded)
            {
                return true;
            }

            // check if file exists, copy it to current dir

            foreach (string path in searchDir)
            {
                string dllPath = path + "\\" + dll.Name;
                if (File.Exists(dllPath))
                {
                    if (!File.Exists(dll.Name))
                    {
                        // copy to this dir
                        // create symbol links
                        CreateHardLink(new FileInfo(dll.Name).FullName, new FileInfo(dllPath).FullName, IntPtr.Zero);
                        symbolLinks.Add(dll.Name);
                        rerun = true;
                        //File.Copy(dllPath, dll.Name);
                    }
                    break;
                }
            }

            if (File.Exists(dll.Name))
            {
                dll.Path = Directory.GetCurrentDirectory() + "\\" + dll.Name;
            }
            //Console.WriteLine("Checking {0}", dll);
            string output = "";
            try
            {
                string process = "dumpbin.exe";
                if (!isRunUnderVs())
                {
                    if (!Environment.Is64BitProcess)
                    {
                        process = @"C:\Program Files (x86)\Microsoft Visual Studio 14.0\VC\bin\dumpbin.exe";
                    }
                    else
                    {
                        process = @"C:\Program Files (x86)\Microsoft Visual Studio 14.0\VC\bin\amd64\dumpbin.exe";
                    }
                    if (!File.Exists(process))
                    {
                        throw new Exception("Must be run under visual command");
                    }
                }
                output = CallProcess(process, string.Format("/dependents {0}", dll.Name));
                //if (output.Contains("fatal error LNK1181: cannot open input file"))
                //{
                //    return false;
                //}
                //Console.WriteLine("Parse out: {0}", output);
                //if (!output.Contains("Image has the following dependencies"))
                if (!output.Contains("fatal error LNK1181: cannot open input file"))
                {
                    if (!isDotNet(dll.Name))
                    {
                        if (analyzeNativeLib(ref dll))
                        {
                            dll.IsLoaded = true;
                            output = CallProcess(process, string.Format("/dependents {0}", dll.Path));
                        }
                        else
                        {
                            addError(dll);
                        }
                    }
                    else
                    {
                        // check if this is a .net library
                        try
                        {
                            Assembly ass;
                            if (File.Exists(dll.Name))
                            {
                                ass = Assembly.LoadFrom(dll.Path);
                            }
                            else
                            {
                                ass = Assembly.Load(dll.LongName);
                                dll.Path = ass.Location;
                            }
                            if (ass == null)
                            {
                                Console.WriteLine("Dll {0} not exist in current path, please copy it to this dir or ignore", dll);
                                missing.Add(dll);
                            }
                            else
                            {
                                //Console.WriteLine("Load {0} success", dll);
                                // success.
                                //dlls.Remove(dll);
                                //dll.IncreaseRef();
                                AnalyzeDotNet(ref dll, ref output, ref dlls);
                                dll.IsLoaded = true;
                                return true;
                            }
                        }
                        catch (Exception ex)
                        {
                            try
                            {
                                if (!isDotNet(dll.Name))
                                {
                                    if(analyzeNativeLib(ref dll))
                                    {
                                        dll.IsLoaded = true;
                                    }
                                    else
                                    {
                                        addError(dll);
                                    }
                                }
                                else
                                {
                                    dll.IsDotNet = true;
                                    AnalyzeDotNet(ref dll, ref output, ref dlls);
                                }
                            }
                            catch (Exception ex2)
                            {
                                if (!File.Exists(dll.Name))
                                {
                                    missing.Add(dll);
                                }
                                else
                                {
                                    addError(dll);
                                    //Console.WriteLine("one or more depedents of dll : {0} is not exist in this dir", dll);
                                }
                                return false;
                            }
                        }
                    }
                }
                else
                {
                    // if dumpbin succeeded

                    // check if is c++ lib
                    if (!isDotNet(dll.Name))
                    {
                        if (analyzeNativeLib(ref dll))
                        {
                            dll.IsLoaded = true;
                        }
                        else
                        {
                            addError(dll);
                        }
                    }
                    else
                    {
                        dll.IsDotNet = true;
                        AnalyzeDotNet(ref dll, ref output, ref dlls);
                    }
                }
            }
            catch (Exception ex)
            {
                addError(dll);
                return false;
            }

            parseOutput(ref dll, output, ref dlls);
            //Console.WriteLine("Load {0} success", dll);
            // remove dll from list
            //dlls.Remove(dll);


            return false;
        }

        static void analyze(ref List<DllRef> dlls, DllRef dlRef)
        {
            if (dlRef.DllRefs.Count == 0)
            {
                // move to top
                dlls.Remove(dlRef);
                dlls.Insert(0, dlRef);
                return;
            }
            // more than one ref
            int curIndex = dlls.IndexOf(dlRef);
            // find maximum index of child list
            //dlRef.DllRefs.IndexOf()
        }

        static void calRef(DllRef dlRef)
        {
            dlRef.IncreaseRef();
        }

        private static void PrintOrder(string dir, ref List<DllRef> dlls)
        {
            var files = from file in Directory.GetFiles(dir) where file.EndsWith(".dll") select file;
            foreach (var file in files)
            {
                dlls.Add(new DllRef(new FileInfo(file).Name));
            }
        }

        static void PrintNative(string dir)
        {
            var files = from file in Directory.GetFiles(dir) where file.EndsWith(".dll") select file;
            foreach (var file in files)
            {
                if (!isDotNet(new FileInfo(file).Name))
                {
                    Console.WriteLine(file);
                }
            }
        }

